import logo from './logo.svg';
import './App.css';
import EditProfile from './views/Editprofile/EditProfile';
import AddDoctor from './views/AddDoctor/AddDoctor';
import DoctorSignin from './views/DoctorSignin/DoctorSignin';
import AdminLogin from './views/AdminLogin/AdminSignin';
import AdminPanel from './views/AdminPanel/AdminPanel';
import Payment from './views/Payment/Payment';
import AddPayment from './views/Payment/AddPayment';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
            <Route path='/' element={<EditProfile/>} />
          </Routes>
          <Routes>
            <Route path='/adddoctor' element={<AddDoctor/>} />
          </Routes>
          <Routes>
            <Route path='/DoctorSignin' element={<DoctorSignin/>} />
          </Routes>

          <Routes>
            <Route path='/AdminLogin' element={<AdminLogin/>} />
          </Routes>

          <Routes>
            <Route path='/AdminPanel' element={<AdminPanel/>} />
          </Routes>
          
          <Routes>
            <Route path='/Payment' element={<Payment/>} />
          </Routes>
         
          <Routes>
            <Route path='/AddPayment' element={<AddPayment/>} />
          </Routes>
         
         

      </Router>


      
        
    </div>
  );
}

export default App;
